import React from 'react';
import {Badge, ListGroup} from "react-bootstrap";

const OrderItem = ({order}) => {
    return (
        <div className="p-2 m-1 d-flex justify-content-between">

                <ListGroup >
                    <ListGroup.Item className="d-flex justify-content-between" style={{width:700}} action variant="danger">
                        <div>
                            <div style={{fontSize:20}}>
                                {order.client_name}

                            </div>
                            <div style={{color:"grey"}}>
                                {order.city}

                            </div>


                        </div>
                        <div>
                            <div>
                                {order.status}
                            </div>
                            <div style={{minWidth:190}}>
                                {order.payment_status}
                            </div>

                        </div>
                    </ListGroup.Item>

                </ListGroup>

        </div>
    );
};

export default OrderItem;
